import React, {useState} from 'react';

function SelButton(props) {
    const [tab, setTab] = useState('sel-button');
    return (
        <div>
            <button className={tab} onClick={()=>setTab('on-sel-click')}>{props.answer}</button>
        </div>
    );
}

export default SelButton;
